import logo from './logo.svg';
import './App.css';
import Button from '@material-ui/core/Button'
import SaveIcon from '@material-ui/icons/Save'

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Button
        startIcon={<SaveIcon/>}
        // endIcon={<SaveIcon/>}
        size='large'
        // disabled
        style={{
          fontSize:28
        }}
        variant='contained'
        color='primary'
        >
          Hello
        </Button>
        <img src={logo} className="App-logo" alt="logo" />
      </header>
    </div>
  );
}

export default App;
